import React from 'react'
import pic from './pinlight.png'
import './about.css'
const About = () => {
    return ( 
        
      <>
      <div className="row">
          
          <div className="col-6">
              <img src={pic} alt="" className="im mt-3" />
          </div>
      </div>
      </>

     );
}
 
export default About;
